Defendant Kimberly L. Tokar in court with attorney Munjed A. Ahmad.  Kurt Brian Benkley appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Mr. Rodney O.  The Court imposed the following sentence:

AS TO COUNT 01:
Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years   with credit for 3 days time served.  Defendant shall serve 2 years on EXTENDED SUPERVISION. 
 * Court ordered defendant to provide a DNA sample.

AS TO COUNT 26:
Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years concurrent to Count 1.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years with credit for 3 days time served.  Defendant shall serve 2 years on EXTENDED SUPERVISION.

AS TO COUNT 27:
Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years concurrent to Count 26.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years with credit for 3 days time served.  Defendant shall serve 2 years  on EXTENDED SUPERVISION

The defendant is eligible for the Challenge Incarceration Program, but not  for the Wisconsin Substance Abuse Program.  The Court advised the defendant of her determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.  The Court STAYED THE SENTENCES and placed the defendant on probation to the State Department of Corrections for a period of six (6) years, concurrent to one another.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No contact with Midwest Real Estate Company or 5055 South 55th Street, Greenfield, Wisconsin;
 - No involvement with real estate;
 -Remain controlled substance and alcohol free;
 - Urine screens;
 - AODA assessment; treatment, if necessary;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Parenting classes/counseling;
 - No contact with co-defendant Kim Pinnow-Johnson;
 - Serve 4 months condition time at the House of Correction; Huber for work and child care. Court stayed report date to 5:00 p.m. on 9/29/14.  Court stayed 2 months condition time, no good time or Huber, to be used at the discretion of the  agent for any violations.
 - Pay restitution in the amount of $104,877.74, joint and several with co-defendant Kim Pinnow-Johnson (14CF1128), to CHUBB Group Insurance Company, P.O. Box 2002, Simsbury, CT  06070-7683; pay DNA surcharges for Counts 1, 26, and 27, plus all other applicable surcharges, costs and disbursements.  Should defendant get revoked and be sent to prison, Court ordered monies taken from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.  Failure to pay all amounts in full would result in a civil judgment entered against defendant which is non-dischargable in bankruptcy.

